import React from 'react';


const InforCard = ({info}) => {
    return (
        <div className="col-md-4 d-flex justify-content-center">
            <div>
            <img style={{height:"1rem", width:"1rem"}} src={info.icons} alt=""/>

            </div> 
           <div>
            <h4>{info.title}</h4>
            <p>{info.description}</p>
           </div>
        </div>
    );
};

export default InforCard;
